import './App.css';
import React , {Component} from "react"
import { NavBar } from './components/NavBar';
import { News } from './components/News';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

export default class App extends  Component {
  render() {
    return(
    <div>
      <NavBar/>
      <BrowserRouter>
      <Routes>
        <Route path="/"><News pageSize = {6} country="sa" category = "general"/></Route>
        <Route path="/business"><News pageSize = {6} country="sa" category = "business"/></Route>
        <Route path="/entertainment"><News pageSize = {6} country="sa" category = "entertainment"/></Route>
        <Route path="/health"><News pageSize = {6} country="sa" category = "health"/></Route>
        <Route path="/science"><News pageSize = {6} country="sa" category = "science"/></Route>
        <Route path="/sports"><News pageSize = {6} country="sa" category = "sports"/></Route>
        <Route path="/technology"><News pageSize = {6} country="sa" category = "technology"/></Route>
        </Routes>
        </BrowserRouter>
      </div>
    )
  }
}
